import React from "react";
import Card from "./card";
import "./styles.css";

const cardStyling ={

}
function Stuff() {
  return (
    <div className="card-container" style={cardStyling}>
      <Card
        url="./projects.jpg"
        alt="Projects"
        alignment="left"
        key={1}
        name="My Projects"
      />
      <Card
        url="./blogs.jpg"
        alignment="right"
        key={2}
        name="My Blogs"
      />
    </div>
  );
}

export default Stuff;
